var query,filter,list,listItems,txtValue;query=getUrlParameter("q");filter=query.toUpperCase();list=document.getElementById("results");listItems=list.getElementsByTagName("a");document.getElementById("results-for").innerHTML=query;for(i=0;i<listItems.length;i++){txtValue=listItems[i].innerHTML;if(txtValue.toUpperCase().indexOf(filter)>-1){listItems[i].style.display=""}else{listItems[i].style.display="none"}}function getUrlParameter(a){a=a.replace(/[\[]/,"\\[").replace(/[\]]/,"\\]");var c=new RegExp("[\\?&]"+a+"=([^&#]*)");var b=c.exec(location.search);return b===null?"":decodeURIComponent(b[1].replace(/\+/g," "))};